<?php

/**
 * 系统文件
 */

namespace Home\Model\System;

use Home\Model\Common\LogUtils;
use Home\Model\Common\SessionManager;
use Home\Model\Entry\MasterManager;

class System000051
{
    /**
     * @brief: 特殊数据内容段
     * @return string
     */
    public static function getSpecialCodeFragment()
    {
        // Linux商城 lmp=148  -- 不上报数据
        if (MasterManager::getEnterPosition() == 148) {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        if (MasterManager::getAreaCode() == '208' && MasterManager::getEnterPosition() != 251) {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        if (MasterManager::getAreaCode() == '204') {
            //只对入口332,356,367进行计费
            $areaCode = array(332,356,367,403,304,410);
            if(!in_array(MasterManager::getEnterPosition(), $areaCode) || preg_match('/[a-zA-Z]/',MasterManager::getAccountId())){
                $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
                return $data;
            }
        }

        if (MasterManager::getAreaCode() == '201') {
            $areaCode = array(89,389);
            if(!in_array(MasterManager::getEnterPosition(), $areaCode)){
                $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
                return $data;
            }

            $tm = MasterManager::getEnterAppTime();
            if(time() - $tm < 30){
                return "wait";
            }
        }

        $accountId = MasterManager::getAccountId();
        if(strpos($accountId,'zte') !== false || strpos($accountId,'hw') !== false){
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        LogUtils::info("System000051::getSpecialCodeFragment ---> start");
        $isReportUser =  MasterManager::isReportUserInfo();
        LogUtils::info("System000051::getSpecialCodeFragment ---> isReportUser" . $isReportUser);
        if ($isReportUser == 1) {
            $data = "";
        } else {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
        }
        LogUtils::info("System000051::getSpecialCodeFragment ---> data" . $data);
        return $data;
    }

    /**
     * @brief: 积分商城：特殊数据内容段
     * @return string
     */
    public static function getPointExchangeCodeFragment() {

        LogUtils::info("System000051::getPointExchangeCodeFragment ---> start");
        $isReportUser =  MasterManager::isReportUserInfo();
        LogUtils::info("System000051::getPointExchangeCodeFragment ---> isReportUser" . $isReportUser);
        if ($isReportUser == 1) {
            $data = "";
        }  else {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
        }
        LogUtils::info("System000051::getPointExchangeCodeFragment ---> data" . $data);
        return $data;
    }
}